import React from 'react'
import './loginpage.css'

function LoginPage (){
    return (
        <div class='loginpage'>
            <div class='loginInputs'>
                    <input/>
                    <input/>
            </div>
            <div class='loginButton'>
                <button>sign up</button>
                <button>log in</button>
            </div>
        </div>);
}

export default LoginPage;
